import React from "react";
import { Link } from 'react-router-dom';

function Formcuenta(){
    return (
        <div className="contenedor-formcuenta">
            <div className="col">
                <div className="row">
                    <div className="h4">Completa los datos para crear tu cuenta</div>
                </div>
                <div className="row">
                    <ul>
                        <li>
                            <label htmlFor="nombreUsuario">Agrega tu e-mail</label>
                            <Link to="" className="btn btn-warning butonn">Agregar</Link>
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default  Formcuenta;
